import React from "react";

type AttendanceCardProps = {
  headerText: string;
  bodyText: number | string;
  subBodyText?: string;
};

const AttendanceCard = ({
  headerText,
  bodyText,
  subBodyText
}: AttendanceCardProps) => {
  console.log(React);
  return (
    <div>
      <h4>{headerText}</h4>
      <div>
        <div>{bodyText}</div>
        {subBodyText && <div>{subBodyText}</div>}
      </div>
    </div>
  );
};

export default AttendanceCard;
